import { useEffect } from "react"
import { useDispatch } from "react-redux"
import { CurrentTab } from "../../redux/general/general"

const Deploy = () => {
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(CurrentTab("deploy"))
    }, [])
    return(
        <>
            <h1>Deploy</h1>
        </>
    )
}

export default Deploy
